    fun parseJson(JSON: String) : ArrayList<Pair<GifDataModel, GifDataModel?>>{
        var arrayJSON = JSONObject(JSON).array("data")
        val alDataModelParsed : ArrayList<Pair<GifDataModel, GifDataModel?>> = ArrayList()
        var firstGif : GifDataModel? = null
        var secondGif : GifDataModel? = null
        for (i in 0 until arrayJSON.length()){
            var jsobjCurrent = arrayJSON.jsonObject(i)
            var filledGif = GifDataModel(
                jsobjCurrent.str("id"),
                jsobjCurrent.str("title"),
                jsobjCurrent.str("username"),
                jsobjCurrent.getJSONObject("images").getJSONObject("original").str("url"))
            if (firstGif == null){
                firstGif = filledGif
                secondGif = null
            }
            else{
                secondGif = filledGif
                alDataModelParsed.add(Pair(firstGif, secondGif))
                firstGif = null
            }
        }
        alDataModelParsed.add(Pair(firstGif!!, null))
        return alDataModelParsed
    }

